import React from "react";
import './home.styles.scss'
const Home = () => {
  return (
    <div className="home">
      <div className = 'home-main'>
      <h1 style={{fontFamily:'Playball, cursive' }}>HOME</h1>
      <div className = 'headshots' style  ={{display:'flex', flexDirection:'row'}}>
        <img width='33%' src='https://i0.wp.com/calliebabilot.com/wp-content/uploads/2020/12/IMG_5269.jpg?fit=300%2C300&ssl=1'/>
        <img width='33%' src='https://i0.wp.com/calliebabilot.com/wp-content/uploads/2020/12/IMG_5268.jpg?fit=300%2C300&ssl=1'/>
        <img width='33%' src='https://i0.wp.com/calliebabilot.com/wp-content/uploads/2020/12/IMG_5267.jpg?fit=300%2C300&ssl=1'/>

      </div>
      <h1 style={{fontFamily:'Playball, cursive' }}>A few things about me...</h1>
    <p>
    My name is Callie Babilot and I am a 22 year old graphic designer based in Paramus, NJ. From a very young age, I became obsessed with creatively expressing myself through my artistic abilities. I picked up hobbies including drawing, painting, illustration, and photography which have happily brought me to where I am now.</p>
<p>
Fast forward years later, and the flow of artistry never stopped. I have now graduated from Stockton University with a Bachelor of Fine Arts Degree with a concentration in Visual Communications.</p>

<p>There is nothing I love more than being outdoors or traveling somewhere outside of my usual surroundings. I tend to develop inspiration for art through my environment, the people I meet, and the things I love doing. Therefore, I tend to gain new perspectives on life every moment that I can, thus benefitting my career and passion for art.</p>
      </div>
      <div className = 'home-inspiration'> inspo</div>
    </div>
  );
};

export default Home;
